import './App.css';
import Navbar from './components/Navbar';
import Home from './components/Home';
import { Route,Routes } from 'react-router';



function App() {
  return (
    <div className="App">
     <Home/>

     <Routes>

      <Route path='/' element={<Home></Home>}></Route>
     </Routes>
    </div>
  );
}

export default App;
